import React from "react";
import "./Login.css";

function Login() {
  return (
    <>
      <div className="container">
        <div className="card">
          <form>
            <div className="form-group">
              <div className="row">
              <label for="exampleInputEmail1">Enter the code</label>
              </div>
              <div className="row">
              <input class="form-control" id="exampleInputEmail1" placeholder="Enter the code" />
              </div>
              <div className="row">
              <button type="button" className="btn btn-secondary btn-block"> LOGIN </button>
              </div>
            </div>
          </form>
        </div>
      </div>
    </>
  );
}

export default Login;
